&lt;p&gt;Buğdaydan esmere dönük ten rengine sahip kişiler için uygundur. Kahverengi tonları ile hem gece hem de gündüz makyajı için tercih edilebilir. İpeksi, doğal bir görünüm yaratır. &lt;br /&gt;&lt;/p&gt;
