&lt;b&gt;Edding 260 Tahta Kalemi&lt;/b&gt;, siyah ve kırmızı renklerde 2 adet tahta kaleminden oluşan bir settir.
&lt;br /&gt;
&lt;br /&gt;Ürün, sınıfta ya da derslikte tahtaya yazı yazarken detayları siyahla vurguları ve başlıkları kırmızı ile belirtebileceğiniz bir tahta kalemi setidir. Kolayca kullanabileceğiniz kalemler ergonomik yapıda ve kolay silinebilen özelliktedir.
&lt;br /&gt;
&lt;br /&gt;Edding 260 Tahta Kalemi ürününü, Migros Sanal Market’in 
&lt;b&gt;Tahta Kalemi &lt;/b&gt;reyonundan satın alabilir, tek tıkla online sipariş verebilir, ödemeyi 
&lt;b&gt;online olarak ya da kapıda kredi kartıyla&lt;/b&gt; gerçekleştirerek siparişinizi aynı gün içinde teslim alabilirsiniz.
&lt;br /&gt;

&lt;b&gt;Edding Çok Amaçlı Kalem-149 Tekli BLS Siyah&lt;/b&gt;, cam ya da cd gibi metal yüzeylere de uygulanabilen kâğıt üzerine yazmak amacıyla da kullanılabilen ve silinmeyen siyah renkte mürekkebe sahip kalemdir.
&lt;br /&gt;
&lt;br /&gt;Ürün, CD’ler üzerine ne hakkında olduklarını yazmak, cam üzerinde işaretleme yapmak, tasarım yaparken ahşap, alçı, taş gibi yüzeylerde ölçü belirtmek ve kağıt üzerine not almak gibi çok amaçlı kullanım için uygun bir kalıcı mürekkebe sahip kalemdir. 
&lt;br /&gt;
