&lt;br /&gt;

&lt;b&gt;Edding Fineliner 2’li Mavi ve Kırmızı&lt;/b&gt;, çizgili klasik tükenmez kalem tasarımında uzun ömürlü kırmızı ve mavi renklerde 2 adet tükenmez kalemden oluşur. 
&lt;br /&gt;
&lt;br /&gt;Çalışma masanızda, kalem kutunuzda, ofisteki kalemliğinizde, çantanızda mutlaka bulunması gereken mavi ve kırmızı renk tükenmez kalemlerden oluşan 2’li set, kolay kullanımı ve kalıcı parlak renkleriyle klasik tükenmez kalemle yazma keyfini sunuyor.
