&lt;br /&gt;
&lt;div&gt; 
 &lt;br /&gt;İster çocuklar ödev, resimleri için ister yetişkinler toplantıları ya da günlük notları için herkesin yanında bulundurabileceği bir settir. Uç kırılmasına karşı direnci arttıran özel yapıştırma sistemi sayesinde rahat yazım imkanı sunar. 
&lt;/div&gt;
&lt;br /&gt;FC Bls. Kuruboya 12';li Set Yeni ürününü Migros Sanal Market';in 
&lt;b&gt;Kuru Boya &lt;/b&gt;reyonundan satın alabilir, tek tıkla online sipariş verebilir, ödemeyi 
&lt;strong&gt;online olarak ya da kapıda kredi kartı &lt;/strong&gt;ile gerçekleştirebilir, ürününüzü aynı gün içinde teslim alabilirsiniz.

&lt;p&gt;Okul çantalarının vazgeçilmezi Adel kuru boya kalemi, çocuklarınızın hayallerini kağıda dökmesi için rengarenk kalemler üretiyor. Yere düştüğünde içi kolay kolay kırılmayan kalemlerin ucu da en az dışları kadar sağlam. Adel 12&;#39;li boya kalemi, içinde barındırdığı renkler sayesinde gökkuşağının tüm tonlarını sayfalara işliyor. &lt;/p&gt;

&lt;p&gt;Çocuğunuzun sıkılmadan resim ve boya yapmasını hedefleyen Adel kuru boya kalem seti elleri boyamıyor. Yanlışlıkla kullanıldığında kağıt üzerinde iz bırakmadan kolayca siliniyor. Güvenle alıp çocuğunuza hediye edebileceğiniz Adel 12&;#39;li boya kalemi setini satın almak için alışverişe hemen başlayabilir, ürünü sepetinize ekleyebilirsiniz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Kuru boya kalemleri resim yapmanın temel araçlarındandır. School Time kuru boya kalemleri 12 renkten oluşur. Çocuklardan yetişkinlere her yaşa hitap eden canlı tonlarıyla kuru boya kalemleri ile resimlerinizi en iyi şekilde boyayabilirsiniz. Zengin pigmentli kuru boya kalemleri, boyanan nesneleri ve desenleri daha canlı ve parlak gösterir.&lt;/p&gt;

&lt;p&gt;12&;#39;li kuru boya seti kalıcı renkleri sayesinde resim kağıdınızın üzerinde her zaman canlı görünür. Kalitesi sayesinde boyama veya çizim yaparken kağıdın üzerinde kolay bir şekilde hareket ettirebilirsiniz. Aynı zamanda esnektir ve kolay deforme olarak kırılmaz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Faber Castell kalitesi, tüm mekanik kalem tipleriyle uyumlu Super Fine 0.7 kalem uçları ile yine yanınızda oluyor. Doygun yapıdaki kalem ucu sayesinde fazla bastırmadan rahatça yazabilirsiniz. Kırılmalara dayanıklı özelliğe sahiptir, kullanım ömrü uzundur. Güvenli kapak yapısı ile siz istemeden açılmaz ve uçlar dağılmaz. Faber Castell kalem ucunu, proje ödevlerinizden mimari çizimlerinize kadar dilediğiniz her yerde rahatlıkla kullanabilirsiniz. &lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Ürün Özellikleri &lt;/strong&gt;&lt;/p&gt;

&lt;ul&gt;&lt;li&gt;4&;#39;lü paket halinde&lt;/li&gt;&lt;li&gt;Her kutuda 75 mm uzunluğunda 24 adet uç&lt;/li&gt;&lt;li&gt;Kalınlık 0.7 (orta kalınlıkta)&lt;/li&gt;&lt;li&gt;Kalem ucu sertlik derecesi 2B&lt;/li&gt;&lt;/ul&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Faber Castell Apollo Versatil 0.7 mm In Pastel, net ve okunaklı yazı yazma imkanı sunuyor. 0.7 mm uç özelliği sayesinde kalın, kaliteli ve uçup gitmeyen notlar oluşturmanıza fırsat sağlıyor. Yazı yazmanın dışında geometrik şekil ve tasarımlar için de kullanılabiliyor.&lt;/p&gt;

&lt;p&gt;Mimari ve grafik işleri için de tercih edilebilen uçlu kalemlerle sanatsal ya da teknik çizimler yapılabilme deneyimi sağlıyor. Kalın ve net yazı yapısıyla dikkat çekiyor. Elde tutuşu rahat olan Faber Castell Apollo uçlu kalem, sanatsal süreçlerinizi daha keyifli bir hâle getiriyor.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Faber Castell Metal Kalemtıraş ve Silgi Seti öğrenciler arasında yaygın olarak kullanılan ve en sık satın alınan kırtasiye malzemelerinden bir tanesidir. &lt;/p&gt;

&lt;p&gt;Setin içerisindeki kalemtıraş her türlü gövdeye sahip (yuvarlak, köşeli, üçgen vb.) kurşun kalemler ve boya kalemleri için uygun olarak tasarlanmıştır. Metal gövdeye sahiptir. Bu sebeple uzun süre sağlamlığını korumaktadır. Rahat tutuşu sayesinde kullanımı pratik bir kırtasiye malzemesidir. Setin toplam ağırlığı 27.2 gramdır.&lt;/p&gt;

&lt;p&gt;Setin içerisindeki bandrollü beyaz silgi ise kağıt, aydınger ve film üzerindeki kurşun kalem yazılarını iz bırakmadan silerek temizlemektedir. Yumuşak malzemesi sayesinde temizlediği yüzeyde deformasyon izi oluşturmamaktadır. Avuç içine kolaylıkla sığarak, parmaklarla rahat bir şekilde kavranabilmektedir.&lt;/p&gt;

&lt;p&gt;Menşei: Çin&lt;/p&gt;

