&lt;br /&gt;Neşeli mavi ve temiz silme hissi veren beyaz renkteki silgilerle not almak çok eğlenceli. Kaliteli silgi dokusu, yumuşak ve kâğıda zarar vermeyen silme özelliği ile Faber Castell 2 Mavi ve Beyaz Renk Silgi çok kullanışlı bir ürün.
