&lt;p&gt;&lt;b&gt;Edding Beyaz Yazı Tahtası Kalemi&lt;/b&gt;, 4 adet beyaz yazı tahtası kaleminden oluşan bir settir.&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Okulda, derslikte, ofiste hatta evde mutfakta kullanabileceğiniz bir yazı tahtasında değerlendirebileceğiniz bir üründür. &lt;br /&gt;&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Edding Beyaz Yazı Tahtası Kalemi 4’lü ürününü, Migros Sanal Market’in &lt;b&gt;Yazı Tahtası &lt;/b&gt;reyonundan satın alabilir, tek tıkla online sipariş verebilir, ödemeyi &lt;b&gt;online olarak ya da kapıda kredi kartıyla &lt;/b&gt;gerçekleştirerek siparişinizi aynı gün içinde teslim alabilirsiniz.&lt;/p&gt;

&lt;p&gt;&lt;b&gt;Avant Yazı Tahtası Silgisi,&lt;/b&gt; keçeli ucu ile yüzeyde kolayca kayarak yazı ya da leke silmeyi kolaylaştıran kullanışlı bir tahta silgisidir. &lt;br /&gt;&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Kolayca tutmayı sağlayan ergonomik gövdesi, keçe yüzeyiyle silerken yormayan yapısıyla dayanıklı ve kullanıcı dostu bir üründür. Ofisinizdeki yazı tahtasını silmek için, okulda ya da derslikte yazı tahtasını silmek için hatta mutfağınızdaki yemek listesini yazdığınız eğlenceli tahtayı silmek için kullanabilirsiniz.&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Avant Yazı Tahtası Silgisi ürününü, Migros Sanal Market’in &lt;b&gt;Organizer&lt;/b&gt; reyonundan satın alabilir, tek tıkla online sipariş verebilir, ödemeyi &lt;b&gt;online olarak ya da kapıda kredi kartıyla&lt;/b&gt; gerçekleştirerek siparişinizi aynı gün içinde teslim alabilirsiniz.&lt;/p&gt;

&lt;p&gt;Kırtasiye setleri okul dönemi boyunca hem evde hem okulda sürekli kullanılan ürünlerin başında gelir. Dolphin Lisanslı Kırtasiye Seti 5 Parça ürünle, bütün öğrencilerin ihtiyaç duyduğu okul malzemelerini tek bir paket içerisinde sunuyor. Dolphin 5 parça kırtasiye seti lisanslı olduğu için oldukça sağlam ve uzun süreli bir kullanım sunuyor. Özellikle anaokulu ve ilkokul çağındaki çocukların dikkatini çekecek baskılarla üretilen set, her öğrencinin çantasında kendine yer buluyor.&lt;/p&gt;

&lt;p&gt;Dolphin 5 parça kırtasiye setinin içerisinde bulunan ürünler:&lt;/p&gt;

&lt;ul&gt;&lt;li&gt;1 kalem&lt;/li&gt;&lt;li&gt;1 silgi&lt;/li&gt;&lt;li&gt;1 cetvel&lt;/li&gt;&lt;li&gt;1 kalemtıraş&lt;/li&gt;&lt;li&gt;1 kalem kutusu&lt;/li&gt;&lt;/ul&gt;

&lt;p&gt;Faber Castell Mini Apple Kalemtıraş Neon, öğrenciler kadar yetişkinlerin de tercih ettiği bir üründür. Oldukça şık bir tasarıma sahip olan kalemtıraşın geniş çöp haznesi sayesinde kalemlerinizi açarken kalem artıkları etrafa saçılmaz. Hazne kısmı şeffaftır, bu sayede çöp doluluk oranını rahatça görebilirsiniz.&lt;/p&gt;

&lt;p&gt;Turuncu, pembe, mavi ve yeşil olmak üzere 4 neon renk seçeneği ile üretilen kalemtıraşı, standart ölçülerdeki kurşun kalem ve boya kalemlerinizin kırılan ucunu açmak veya sivriltmek için kullanabilirsiniz.&lt;/p&gt;

&lt;p&gt;Faber Castell Mini Apple Kalemtıraş Neon, paslanmaz keskin bıçağı ve dayanıklı gövdesi sayesinde uzun yıllar, sorunsuz bir kullanım imkanı sunar. PVC içermez, insan ve çevre dostudur.&lt;/p&gt;

&lt;p&gt;Tuttuğu takımın renklerini okul hayatında da görmek isteyen öğrencilerin beğenisine sunulan Frocx Bjk Kalem Çantası Salto Balloon, Karakartal tutkunu gençlere okul hayatında başarılar diliyor. Siyah beyaz renklerden oluşan tasarımı ve kaliteli yapısıyla çocuğunuzun kullanmaktan büyük keyif alacağı ürün, öğrencilerin ihtiyacını başarılı bir şekilde karşılıyor.&lt;/p&gt;

&lt;p&gt;Fermuarlı yapısı sayesinde kalem, silgi ve kalemtıraş gibi malzemelerin dağılmasını ve kaybolmasını önleyen Frocx Bjk Kalem Çantası Salto Balloon, Beşiktaş taraftarı çocuğunuza hediye edebileceğiniz en kullanışlı ürünlerden biri. Kalem kutusunu satın alarak siz de çocuğunuzun ihtiyaç listesindeki eksiklerden birini hemen tamamlayabilirsiniz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Barbie Kalem Çantası Salto Shine Pink, pembenin en güzel tonlarını taşıyan şık tasarımıyla ön plana çıkıyor. Üzerinde kız çocuklarının en sevdiği karakterlerden Barbie figürünün olduğu kalem kutusu, sağlığa zararlı kimyasallar içermeyen kumaşıyla ailelerin de büyük beğenisini topluyor.&lt;/p&gt;

&lt;p&gt;Barbie Kalem Çantası Salto Shine Pink, çift bölmeli ve geniş iç hacimli yapısıyla uzun ömürlü kullanımın garantisini veriyor. Okul araç-gereçlerinin düzenli bir şekilde durmasını ve kolay saklanmasını sağlayan ürün, çocukların okuldaki en büyük yardımcılarından biri oluyor. Eğlenceli desenlere sahip olan kalem kutusu, öğrencilerin derslere uyum sürecini çok daha keyifli bir hale getiriyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Cars Kalem Çantası Salto Rocket Racing, özellikle Arabalar Serisi&;#39;nin hayranı olan çocuklar tarafından çok beğenilen bir kalem kutusudur. Bir yüzünde kırmızı bir araba baskısı ile &;#34;Lightning Strikes&;#34; ve &;#34;Full Throttle&;#34; yazıları, diğer yüzünde ise hız göstergesi desenleri bulunur.&lt;/p&gt;

&lt;p&gt;Dayanıklılığıyla ön plana çıkan Cars lisanslı kalem çantası çift fermuarlıdır. Çocuklar bölmelerin birini kalemlerini, diğerini ise silgi ve kalem ucu gibi kırtasiye malzemelerini koymak için kullanabilir.&lt;/p&gt;

&lt;p&gt;Cars Kalem Çantası Salto Rocket Racing, havalı tasarımı ile çocukların favorisi olmaya adaydır. Öğrenciler, severek kullanacakları bu ürünle hem eşyalarını daha düzenli tutabilir hem de okulu daha çok sevebilir.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Frozen Kalem Çantası Tween Destiny Awaits, Karlar Ülkesi çizgi filmine hayran kız öğrencileri okul sıralarında yalnız bırakmıyor. Üzerinde Elsa karakterinin yer aldığı sevimli ve kullanışlı kalem kutusu, kalitesi yapısı ile hem anne babalardan hem de öğrencilerden tam not almayı başarıyor.&lt;/p&gt;

&lt;p&gt;Öğrencilerin büyük beğenisini kazanan Frozen Kalem Çantası Tween Destiny Awaits, fermuarlı yapısı sayesinde çocuğunuzun kalem, silgi gibi okul araç gereçlerini düzenli bir şekilde yerleştirmesini ve çantasında taşımasını sağlıyor. Siz de çocuğunuzun okuldaki başarısını artırmak için, onu bu kaliteli ve şirin kalem kutusuyla hemen tanıştırabilirsiniz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Çocukların severek izlediği çizgi kahramanlar, kalem çantalarında karşılarına çıkıyor. Frozen Kalem Çantası Due Pink Journey, fermuarlı iki bölmesi ve geniş iç hacmiyle kız öğrencilerin beğenisine sunuluyor.&lt;/p&gt;

&lt;p&gt;Çocukların en sevdiği karakterlerden olan Elsa baskılı bu kalem çantasıyla ders çalışmak daha eğlenceli hale geliyor. Fermuarlara takılı olan kar tanesi baskılı aksesuarlar, fermuarların daha rahat açılıp kapanmasını sağlayarak pratik bir kullanım sunuyor.&lt;/p&gt;

&lt;p&gt;Taşıma askısı da bulunan Frozen Kalem Çantası Due Pink Journey, mavi ve pembe renklerin ağırlıklı olarak kullanıldığı göz alıcı ve şık görüntüsüyle çocukları kendine hayran bırakacak.&lt;/p&gt;

&lt;p&gt;Çocukların en sevdiği çizgi karakterler arasında yer alan Spiderman bu kez kalemlik olarak karşınızda. Frocx Spiderman Kalem Çantası Salto Great Power serisi ile çocuklarınız derslerine Spiderman de eşlik eder. Kaliteli kumaşı ve fermuarı ile uzun ömürlü kullanım sağlar.&lt;/p&gt;

&lt;p&gt;Sağlam dikişleri sayesinde dayanıklıdır. Sert silikondan üretilen fermuar ucundaki Spiderman figürü fermuarın kolayca açılıp kapatılmasına yardımcı olur. Kalemliğin diğer kenarındaki askı bölümü sayesinde kalemliği dilediğiniz yere asabilirsiniz.&lt;/p&gt;

&lt;p&gt;Su geçirmezlik özelliği sayesinde içerisindeki kalem, silgi, kalemtraş gibi malzemeleri güvenli bir şekilde muhafaza eder. Leke tutmaz ve silinebilir kumaşıyla hijyenik bir üründür.&lt;/p&gt;

&lt;p&gt;Okul ya da iş hayatınızda proje hazırlarken ihtiyaç duyduğunuz şeylerin başında iyi bir proje çantası geliyor. Geniş ebatlı çalışmalarınızı ancak bu şekilde zarar görme riski olmadan yanınızda taşıyabilirsiniz. Ayrıca kalem, cetvel ya da gönye takımı gibi ihtiyaç duyduğunuz diğer şeyleri de proje çantanıza koyarak kolayca istediğiniz yere götürebilirsiniz.&lt;/p&gt;

&lt;p&gt;35x50 proje çantası, elde ve omuzda taşıma kolaylığı ile size büyük bir rahatlık sağlayarak, çalışmalarınızı en iyi şekilde muhafaza etmenize yardımcı olacak. &lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Ürün Özellikleri&lt;/strong&gt;&lt;/p&gt;

&lt;ul&gt;&lt;li&gt;Fermuarlı, taşıma asklı ve kulplu&lt;/li&gt;&lt;li&gt;35x50 cm boyutunda&lt;/li&gt;&lt;li&gt;Farklı renk seçenekleri mevcut.&lt;/li&gt;&lt;/ul&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Kullanışlı ve pratik sırt çantası Bond, farklı renk alternatifleri ile beğeni topluyor. Okul çantası olarak tasarlanan ürünü kullanmak için öğrenci olmanız gerekmiyor. Günlük ihtiyaçlarınızı karşılamak için tasarlanan çanta, 4 adet fermuarlı göz ve 2 adet yan cebe sahip.&lt;/p&gt;

&lt;p&gt;İçine kitap, defter, laptop ve tablet konabilen ayrı gözlere sahip ürün, yan ceplerinde matara ve şişe taşımaya uygun açık cepler barındırıyor. Ön kısımda yer alan fermuarlı küçük bölme, cep telefonu ve cüzdanlar için kolay erişilebilir göz görevi görüyor. &lt;/p&gt;

&lt;p&gt;Yolculukta, okulda ve tatilde yanınızdan ayırmayacağınız kullanışlı ve pratik çantaya ekonomik fiyatlar ile sahip olabilirsiniz. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Fermuarlı çift bölmesi ve geniş iç hacmiyle Barbie İlkokul Çantası Trio One To One, Barbie hayranı çocuklar için okul hayatını daha eğlenceli hale getiriyor.&lt;/p&gt;

&lt;p&gt;Çantanın ön bölmesinde bulunan Barbie baskısının yanında rengarenk kalp ve yıldız detaylarıyla, hem şık hem de sevimli görünen bu çanta sayesinde çocuklar okula gitmeyi daha çok sevecek. Çantanın yan kısımlarında bulunan fileli bölmeler de su mataralarını yerleştirebilmek için oldukça ideal.&lt;/p&gt;

&lt;p&gt;Daha rahat taşıma imkanı sunan süngerli sırt paneli ve ayarlanabilir askılarıyla Barbie İlkokul Çantası Trio One To One, çocukların okulda kullandıkları tüm eşyaları kolaylıkla taşımalarını sağlıyor.&lt;/p&gt;

&lt;p&gt;İlkokul çağındaki çocuklar için okul malzemeleri çocuğun okulu sevmesi ve motive olması için büyük önem taşıyor. İstediği ve ilgi duyduğu çizgi film, oyuncak karakteri gibi baskılardan oluşan okul malzemeleri öğrenci için okulu daha ilgi çekici bir hale getiriyor. &lt;/p&gt;

&lt;p&gt;Cars İlkokul Çantası Due Oil Speed ürünü de özellikle erkek çocukların sevdiği baskılardan oluşan ve sıklıkla tercih edilen bir okul malzemesi olarak beğeniye sunuluyor.&lt;/p&gt;

&lt;p&gt;Geniş iç hacmi sayesinde tüm okul malzemelerinin rahatlıkla taşınmasını sağlıyor. Sağlam omuz askıları ve iç astarı sayesinde Cars İlkokul Çantası Due Oil Speed, uzun süreli ve pratik bir kullanım sunuyor. &lt;/p&gt;

&lt;p&gt;Anaokuluna başlayacak miniklerin beğenisini kazanacak olan Cars Anaokulu Çantası Brick Rocket Racing, tasarımını ünlü animasyon Cars&;#39;tan alıyor. Siyah ve kırmızı renklerin ön planda olduğu çanta ergonomik bir yapı sunuyor.&lt;/p&gt;

&lt;p&gt;Çantada fermuarlı ana bölmenin yanı sıra 2 adet fileli yan cep de yer alıyor. Elde taşıma kulpu ve ayarlanabilir omuz askısı sayesinde minikler, bu küçük çantayı rahatlıkla kullanabiliyor.&lt;/p&gt;

&lt;p&gt;Çantanın ana bölmesinin geniş hacmi sayesinde kitap, defter ya da benzeri pek çok kırtasiye ürününün kolay bir şekilde sığacağı çanta, polyester kumaştan üretiliyor.&lt;/p&gt;

&lt;p&gt;Frozen İlkokul Çantası Trio Destiny Awaits, ilkokul çağındaki çocukların bir çantada aradıkları tüm özellikleri onlara sunuyor. Ürün, çift bölmesi ve bölmelerin içindeki alanlar sayesinde kitapları, defterleri ve diğer tüm okul malzemelerini ayrı ayrı ve güvenle saklayabilmeye imkan tanıyor. Bu sayede çocuklar çantaları içindeki tüm malzemelerine kolayca ulaşabiliyor.&lt;/p&gt;

&lt;p&gt;Çocukların severek takip ettiği karakterlerden biri olan Frozen tasarımıyla dikkat çeken Frozen İlkokul Çantası Trio Destiny Awaits, suluk bölümleriyle ise çocukların su şişelerini saklayabilmelerine ve ihtiyaç duyduklarında suya kolayca ulaşabilmelerine imkan tanıyor.&lt;/p&gt;

&lt;p&gt;Frozen İlkokul Çantası Trio Destiny Awaits, bir çocuğun tüm ihtiyaçlarına ve isteklerine en iyi şekilde yanıt vermeyi başarıyor.&lt;/p&gt;

&lt;p&gt;Frozen i·lkokul çantası loft pink journey, çocuklara eğlenceli çanta seçenekleri sunuyor. Karlar Ülkesi filminin sevimli karakteri Elsa&;#39;nın yer aldığı ön yüz, animasyonun hayranlarına hitap ediyor. İki büyük bölmesi bulunan sırt çantasının yan kısımlarında ise iki adet açık göz var.&lt;/p&gt;

&lt;p&gt;Ayarlanabilen sırt askıları yumuşak süngerden üretilen okul çantası, hem elde hem de sırtta taşınabiliyor. İki adet geniş gözü olan çantanın kumaş kalitesi ise yırtılmaya karşı oldukça dayanıklı ve sağlam olduğunu kanıtlıyor. &lt;/p&gt;

&lt;p&gt;İlkokul çocukları için mükemmel bir hediye olabilecek çantayı uygun fiyatlar ile satın alabilir, sevdiklerinizin mutluluklarını paylaşabilirsiniz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Karlar Ülkesi filminin sevimli prensesi Elsa, okula yeni başlayan öğrenciler için hazırlanan Frozen İlkokul Çantası ile sizlerle buluşuyor. Kız çocuklarının favori renklerinden olan mor tonları taşıyan çanta, ön yüzünde Elsa karakteri ve Frozen filmine ait görseller içeriyor.&lt;/p&gt;

&lt;p&gt;Ergonomik kol askıları, sırtı destekleyen yumuşacık sırt yüzeyi, taşıma anında çocuklar için istenilen konforun elde edilmesini sağlıyor. Ön ve arkada yer alan iki adet geniş bölme ile yan bölümlerde bulunan iki file cep çantaya geniş bir kullanım alanı yaratıyor.&lt;/p&gt;

&lt;p&gt;Kar desenli fermuar uçları, sünger destekli taşıma kulpu ve ayarlanabilir omuz askıları, renkli ve eğlenceli çantanın konforlu özelliklere sahip olmasını sağlıyor.&lt;/p&gt;

&lt;p&gt;Sevilen Frozen karakteri Elsa baskılı tasarımı ile küçük hanımları okul sıralarına davet eden Frozen Çekçekli İlkokul Çantası Salto True To Mys, çocuğunuzun en sevdiği okul çantası olmaya aday.&lt;/p&gt;

&lt;p&gt;Çekçekli yapısı sayesinde miniğinizin zorlanmadan taşıyabileceği Frozen Çekçekli İlkokul Çantası Salto True To Mys, buz mavisi rengiyle miniklerin beğenisini kazanıyor.&lt;/p&gt;

&lt;p&gt;Geniş iç hacmi ve kaliteli kumaşı sayesinde çocuğunuzun okul araç gereçlerini rahatlıkla taşıyabileceği ürün, fermuarlı yapısıyla oldukça kullanışlı. Ayrıca yapısında çocukların sağlığını tehdit eden zararlı kimyasallar da bulunmayan okul çantası, ebeveynlerden de tam not alıyor.&lt;/p&gt;

&lt;p&gt;Frocx Unicorn Anaokulu Çantası Loop, slogan desenli çanta modasını çocuk tasarımlarına taşıyor. Anaokulu çocukları için tasarlanan çanta, üzerinde Unicorn temalı farklı ifadeler ve yazılar bulunduruyor. Uçuk pembe ve açık mavi renklerde tasarlanan sevimli çanta, kız çocukların beğenisini topluyor. &lt;/p&gt;

&lt;p&gt;Masalların sihirli atları unicornlardan ilhamla tasarlanan sevimli çanta, şıklığı kadar kullanışlılığıyla da tanınıyor. Bir büyük, bir de küçük göz bulunduran ürün, geniş iç hacimleriyle çocukların rahat etmesini sağlıyor. Ayrıca ayarlanabilir kol askıları üzerinde yer alan süngerler, çocukların taşıma sırasında konforlu hissetmesine yardım ediyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Çocuklar için okula gitmek Frocx Spiderman Anaokulu Çantası Mono Up Upside Down ile şimdi daha keyifli!&lt;/p&gt;

&lt;p&gt;Frocs Spiderman Anaokulu Çantası fermuarlı tek bölmeden oluşur ve geniş iç hacme sahiptir. Suluk ve matara taşımak için sağ ve solda olmak üzere 2 adet yan cebi vardır. Omuz askıları ayarlanabilir özelliktedir ve zarf dikişli olması sayesinde ağırlık taşımaya uygun ve dayanıklıdır. Üst kısmında elde taşıma kulpu bulunur.&lt;/p&gt;

&lt;p&gt;Çantada kullanılan kumaş %100 polyester ve üzerindeki kaplama ise PVC’dir.&lt;/p&gt;

&lt;p&gt;3 yaş ve üzeri çocukların kullanımı için uygundur.&lt;/p&gt;

&lt;p&gt;Frocx Spiderman İlkokul Çantası Loft Wall Crawler, çocuklara okula gitmeyi daha çok sevdirecek bir kırtasiye ürünüdür. Üzerinde Marvel&;#39;in en popüler süper kahramanı olan Örümcek Adam baskısı ve &;#34;Wall Crawler&;#34; yazısı yer alır. Çift bölmesi ve geniş hacmi, öğrencilerin okul eşyalarını rahatlıkla taşımalarını sağlar. Çantanın iki tarafında da suluk cebi bulunur.&lt;/p&gt;

&lt;p&gt;Frocx Spiderman İlkokul Çantası Loft Wall Crawler&;#39;ın arka kısmında yer alan süngerli sırt paneli, çocuklara büyük bir konfor sağlar. Dayanıklılığıyla dikkat çeken çantanın ayarlanabilen kayışları öğrencilere kullanım kolaylığı sunar. Hem şık tasarımıyla hem de konforuyla çocukların favorisi olur.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;b&gt;Şans, New York Times Bestseller&lt;/b&gt; yazarı olan
&lt;b&gt; Karen Kingsbury &lt;/b&gt;tarafından yazılmış romandır. ";Affetmek, Affedeni Özgür Kılar"; başlılığı ile okuyucularla buluşan kitap, akıcı dili ve ilgi çekici öyküsüyle raflardaki yerini alıyor.
&lt;br /&gt;
&lt;br /&gt;(Tanıtım Bülteninden)
&lt;br /&gt;Ona ayakta durma gücü veren ve eve girebilmesini mümkün kılan, nefes almasına olanak sağlayan tek şey, ağaç köklerinin arasına gömülü o eski kutuydu. Kutu, mektuplar ve bugünden on bir yıl sonra ulaşılabilecek son bir şans.
&lt;br /&gt;
&lt;br /&gt;Dağılan hayatınızı toparlamak, hatalarınızı telafi etmek, yaralarınızı sarmak ve ayrılmak zorunda kaldığınız insanlarla tekrar bir araya gelmek için son şansa ne kadar inanabilirsiniz?
&lt;br /&gt;
&lt;br /&gt;İnancınızın sizi nerede ayakta tutup, nerede yalnız bırakacağından nasıl emin olabilirsiniz?
&lt;br /&gt;
&lt;br /&gt;Emin olduğunuz her şeyin ayaklarınızın altından kayıp gittiği bir anda neyin gücüyle ayakta durabilirsiniz?
&lt;br /&gt;
&lt;br /&gt;Son şanslara inanmak, mucizelere inanmak kadar gerçektir.
&lt;br /&gt;
&lt;br /&gt;Basım yılı: 2013
&lt;br /&gt;
&lt;br /&gt;Şans adlı romanı, Migros Sanal Market';in 
&lt;b&gt;Kitap&lt;/b&gt; reyonundan satın alabilir, tek tıkla 
&lt;b&gt;online sipariş&lt;/b&gt; verebilir, ödemeyi 
&lt;b&gt;online ya da kapıda kredi kartı &lt;/b&gt;ile gerçekleştirerek aynı gün içerisinde teslim alabilirsiniz.
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt; 
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;

&lt;p&gt;Elif Şafak&;#39;ın ilk çocuk kitabı olan Sakız Sardunya, arkadaşları alay ettiği için ismini sevmeyen bir kızı konu ediyor.&lt;/p&gt;

&lt;p&gt;Sürekli sorular soran, hayaller kuran Sakız Sardunya, bir gün okul kütüphanesinde sihirli bir küre buluyor ve EFHİMA&;#39;ya yani efsaneler, hikayeler ve masallar ülkesine doğru bir yolculuğa çıkıyor. Burada onu heyecanlı bir macera bekliyor.&lt;/p&gt;

&lt;p&gt;Doğan Kitap tarafından yayınlanan Sakız Sardunya 156 sayfa. Çocuklara dostluk, çevre bilinci, paylaşım, kitap sevgisi kazandırmayı amaçlayan bir kitap.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;&lt;b&gt;Kahvaltıya Dair Her Şey Süleyman Dilsiz&lt;/b&gt;, Anadolu';dan dünyaya açılan farklı kahvaltı kültürlerini sofralarınıza getiriyor. &lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Siz de kahvaltıyı seviyor ve bunun mutlulukla bir ilgisi olduğunu düşünüyorsanız bu kitap tam size göre!&lt;/p&gt; 
&lt;p&gt; &lt;/p&gt; 
&lt;p&gt;Kahvaltıya Dair Her Şey Süleyman Dilsiz ürününü Migros Sanal Market';in &lt;b&gt;Kitap &lt;/b&gt;reyonundan satın alabilir, tek tıkla online sipariş verebilir, ödemeyi &lt;b&gt;online olarak ya da kapıda kredi kartı &lt;/b&gt;ile gerçekleştirerek ürününüzü aynı gün içinde teslim alabilirsiniz.&lt;b&gt;&lt;/b&gt;&lt;/p&gt;

&lt;p&gt;Arkadaşıma Veda, Zülfü Livaneli tarafından yazılmış olan ve Mustafa Kemal Atatürk&;#39;ü merkezine alan bir gençlik kitabı olarak yeni nesle ulu önderi yaşamından kesitler ve hatıralarla tanıma fırsatı veriyor. Kitap, Atatürk&;#39;ün yaveri ve yakın arkadaşı Salih Bozok&;#39;un dilinden anlatılıyor.&lt;/p&gt;

&lt;p&gt;Atatürk&;#39;ün hayatına Selanik&;#39;teki çocukluk yıllarından başlayıp İstanbul&;#39;daki ölümüne kadar şahitlik eden Bozok&;#39;un anılarında yalnızca bir ulusun lideri değil, aynı zamanda en iyi dostu da yer alıyor. Kitap, kurtuluş mücadelesini de tüm çıplaklığıyla gözler önüne seriyor.&lt;/p&gt;

&lt;p&gt;Doğan ve Egmont yayıncılık etiketiyle yayınlanmış olan 192 sayfalık kitap, çocuk ve genç okuyucu kitlesinin yanı sıra tarihe ışık tutan önemli notlarından ötürü yetişkinlere de hitap etmeyi başarıyor.&lt;/p&gt;

&lt;p&gt;Çıkartmalı, okul öncesi etkinlik kitabı serisi olan Hayvanlar Eğlenceli Şekiller kitapları çiftlik, deniz, hayvanat bahçesi ve orman hayvanları temalı dört farklı öğretici kitaptan oluşur.&lt;/p&gt;

&lt;p&gt;Her kitapta farklı bir yerde yaşayan farklı hayvanlara yer veren Eğlenceli Şekiller kitapları, çocuğunuzun tüylü, benekli, çizgili gibi farklı sıfatlara sahip hayvanları tanımasına, renkleri ve şekilleri öğrenmesine yardımcı olur. Kitaplarda ayrıca çocuğunuzun öğrendiklerini pekiştirerek daha kalıcı hale getirmesine yardımcı olan çıkartmalı etkinlikler de bulunur.&lt;/p&gt;

&lt;p&gt;Çakıl yayınlarından çıkan Hayvanlar Eğlenceli Şekiller okul öncesi etkinlik kitabı serisinde yer alan her bir kitap yaklaşık olarak 12 sayfadan ve 100 adet çıkartmadan oluşur.&lt;/p&gt;

&lt;p&gt;Varol Yaşaroğlu ve arkadaşlarının hayat verdiği çizgi dizi, Cartoon Network&;#39;un ilk Türk animasyon filmi olarak hazırlandığında kısa zamanda büyük küçük herkesin sevgisini kazandı.&lt;/p&gt;

&lt;p&gt;Aslan babası Remzi, kedi kız kardeşi Canan, kaplumbağa dedesi Peyami, en yakın arkadaşı, yemek âşığı Fil Necati ve diğerleri... Şakir&;#39;in çılgın, komik ve hayvanlardan oluşan ailesi ile eğlenceli serüvenler çocukları bekliyor.&lt;/p&gt;

&lt;p&gt;Eksik Parça Yayınları tarafından kitaplaştırılan, 2017 yılında yayınlandığı günden bu yana raflardan eksik olmayan &;#34;Kral Şakir - Tek Kişilik Dev Orkestra!&;#34; 208 sayfa ve bol resimli bir içeriğe sahip bulunuyor. Birbirinden eğlenceli hikaye ve çizimleriyle çocukların güle eğlene okuma zevki kazanmasını sağlıyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;b&gt;Çiçek Kitaplar Serisi Gülsüm Cengiz&lt;/b&gt;, çocuklar için 7 kitaptan oluşan öğretici bir seri. 
&lt;br /&gt;
&lt;br /&gt;Çocuklara okuma alışkanlığı kazandırmak ve yepyeni kavramlarla tanışmasını sağlamak için çocuklar için yazılmış, resimli hikaye serilerini kütüphanenize ekleyebilirsiniz. 
&lt;br /&gt;
&lt;br /&gt;

&lt;b&gt;Çocuk Kalbi Edmondo de Amicis&lt;/b&gt;, gerçek bir çocuk klasiği olan Çocuk Kalbi, okumayı yeni öğrenen, gelişme çağındaki çocuklar için oldukça etkileyici bir eser. 
&lt;br /&gt;
&lt;br /&gt;Enrico';nun günlüğünü okuyan çocuklar hem okuma hem de yazma konusunda ilhamla dolacak. 
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;

&lt;b&gt;İcat Çıkarma 2 Rik Kuiper-Tonie Mudde&lt;/b&gt;, yanlış bilinen doğrular ve doğru bilinen yanlışlarla dolu bir bilgi kaynağı. 
&lt;br /&gt;
&lt;br /&gt;Hayatta sıklıkla karşılaştığınız pratik bilgileri bir kez daha düşünmek için bu kitabı okumalısınız. 
&lt;br /&gt;
&lt;br /&gt;

&lt;b&gt;Oyun Peşinde Defne Ongun Müminoğlu&lt;/b&gt;, Renkgiller ailesinin birbirinden farklı karakterlerini okuya çocuklar, bu aileden ilham alabilir. 
&lt;br /&gt;
&lt;br /&gt;Çocukları yepyeni kavramlarla tanıştıran bu keyifli eser, okuma alışkanlığının edinilmesine de katkı sağlıyor.

&lt;b&gt;Kral Şakir ve Ailesi Kollektif&lt;/b&gt;, birbirinden farklı çıkartmalar, rengârenk karakterler ve eğlenceli bir hikaye içeriyor. 
&lt;br /&gt;
&lt;br /&gt;Çocukların çok sevdiği Kral Şakir ve Ailesi';nin maceraları hem yeni kavramlar öğretmekte hem de çocukların okuma alışkanlığı edinmesinde başarılı bir kaynak.

&lt;b&gt;Kral Şakir Macera Devam Ediyor Varol Yaşaroğlu&lt;/b&gt;, okul çağındaki çocukların okuma becerilerini geliştirmesini sağlayan, keyifli bir hikaye serisi. 
&lt;br /&gt;
&lt;br /&gt;Kral Şakir serisi, eğlenceli hikayeleri, büyük puntoları ve anlaşılır dili ile çocuklara okumayı sevdirecek.

&lt;b&gt;Dava Franz Kafka&lt;/b&gt;, 20. yüzyıl insanının yaşam öyküsünü kaleme alan, gerçek bir klasik. 
&lt;br /&gt;
&lt;br /&gt;Dava';da söz konusu yargı süreci, korkunun egemen olduğu 20. yüzyılı aynalayan, oldukça sürükleyici, çok katmanlı bir anlatı.

&lt;b&gt;Gençler için Fotoğraflarla Nutuk Mustafa Kemal Atatürk&lt;/b&gt;, her Türk gencinin okuması önerilen, fotoğraflarla desteklenmiş bir anlatı. 
&lt;br /&gt;
&lt;br /&gt;Atatürk';ün görüş ve düşüncelerini anlamak için kütüphanenizden eksik etmemeniz gereken güçlü bir kaynak.

&lt;b&gt;Üç Kız Kardeş İclal Aydın&lt;/b&gt;, İclal Aydın';ın keyifli anlatımı ile kaleme aldığı, 3 kız kardeşi anlatan sıcacık bir aile hikayesi. 
&lt;br /&gt;
&lt;br /&gt;Ege';nin ufak bir kasabası olan Ayvalık';ta geçip giden tatlı bir çocukluk, yetişkinlik,  acılar ve yeniden iyileşme hikayesi.

&lt;b&gt;Cingo Şermin Yaşar&lt;/b&gt;, bir köpek olan Cingo';nun gözünden aktarılan eğlenceli bir hikaye. 
&lt;br /&gt;
&lt;br /&gt;Çocuklar hem Cingo';nun hayata bakışından çok şey öğrenecekler hem de okuma yeteneklerini geliştirecekler.

&lt;b&gt;Minimalizm Anlamlı Bir Yaşam - Joshua Fields Millburn, Ryan Nicodemus, &lt;/b&gt;son yıllarda sıklıkla rastladığımız minimalizm kavramını, minimalist yaşayan yazarların dilinden aktarıyor. 
&lt;br /&gt;
&lt;br /&gt;İki yazarın bizzat deneyimlediği ve çıkarımlarını paylaştıkları bu kitap, sizin de hayatınızı sadeleştirmenize katkı sağlayabilir.

&lt;p&gt;Kemal Bek Öyküleri; okul öncesi kitapları arasında önemli bir yere sahiptir. Yazar Kemal Bek, okul öncesi çocuklara yönelik ele aldığı öykülerinde hayvan hikayelerine, köylülere, köylere ve daha birçok öğeye yer verir. Çocukların sizden keyifle dinleyebilecekleri ya da okuyabilecekleri bu kitaplar, onlara bir takım bilgileri hikayeler üzerinden öğretmeyi başarır.&lt;/p&gt;

&lt;p&gt;Çocuklarınıza uyumadan evvel ya da günün herhangi bir saati okuyabileceğiniz Kemal Bek öyküleri, onların kitaplara olan sevgisini ve ilgisini geliştirecektir. Öyküler sayesinde hayata dair kazanımlar elde edecek olan okul öncesi çocuklar, böylelikle televizyon, tablet ve telefondan da uzaklaşabilir. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Moda Zamanı 4, kitap sevgisi aşılanmak istenen çocuklar için özel olarak tasarlanmış olan renkli ve eğlenceli bir alternatiftir. Kıyafet ve aksesuar çıkartmaları ile birlikte sunulan Moda Zamanı 4 kitap üzerinde bulunan yönlendirmeler doğrultusunda etiketlerin doğru alanlara yapıştırılmasını gerektirir. Böylece siyah beyaz karakterler ve elbiseleri, renkli hale getirilir.&lt;/p&gt;

&lt;p&gt;Eksik Parça Yayınevi tarafından Türkçe olarak hazırlanmış olan kitap, daha önce yayınlanan Moda Zamanı serisinin üç kitabının devamı niteliğindedir. Kuşe kağıda basılan ve karton kapaklı olan kitap, 16 sayfadan meydana gelir. Çocuklara renkleri kavrama ve parçaları eşleştirme konusunda yardımcı olur.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Merhaba Minik Penguen, sevimli kapak tasarımına sahip olan çıkartmalı bir kitaptır. Hem eğitici hem de öğretici yanları bulunan kitapta miniklerin küçük ellerine uygun 100’den fazla çıkartma yer alır.&lt;/p&gt;

&lt;p&gt;Türkçe dilinde kaleme alınan kitap ile çocuklar bir yandan boyama yaparken diğer yandan da şekillerle uyumlu olan çıkartmaları seçenekler arasından kolayca bulabilir. Kitap sayesinde çocuklarınızın çeşitli hayvanları yakından tanımasını sağlayabilirsiniz.&lt;/p&gt;

&lt;p&gt;Çocukların gözlem yapma yeteneğinin gelişmesine yardımcı olan çocuk kitabı 2 yaş ve üzeri için uygundur. Çocuğunuzun el becerisini artırmak ve gözlem yaparak öğrenmesine katkıda bulunmak için Merhaba Minik Penguen! kitabını tercih edebilirsiniz. &lt;/p&gt;

&lt;p&gt;Bir Fakir Orhan Veli, Türk Edebiyatı&;#39;nın ünlü şairi, Garip akımının kurucusu Orhan Veli&;#39;nin yaşam öyküsünü ve şairlik yolculuğunu resimli hikâyelerle anlatıyor. Çocuklar için Edebiyat serileriyle çocuklara edebî şahsiyetleri eğlenceli ve akılda kalıcı yöntemlerle anlatan Eksik Parça Yayınları, serinin 2. kitabında Orhan Veli&;#39;yi konu alıyor.&lt;/p&gt;

&lt;p&gt;Çocuklara şiir sevgisi kazandırmak, şairlerin hayatlarını kolayca anlatmak ve ilham verme amaçlarını taşıyan Bir Fakir Orhan Veli, hem yazıp hem de çizdiği çocuk kitaplarıyla adını duyuran Erdoğan Oğultekin imzası taşıyor. Resimlerle zenginleştirilen Bir Fakir Orhan Veli kitabı çocuklarına Orhan Veli&;#39;yle tanıştırmak ve edebiyat sevgisi kazandırmak isteyen ebeveynleri bekliyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;20. yüzyıl Türk edebiyatının en önemli temsilcilerinden biri olan Sabahattin Ali, romanlarıyla günümüzde de en çok okunan yazarların başında geliyor. Kürk Mantolu Madonna Sabahattin Ali külliyatı içinde kurgusu ve edebi diliyle okuyucuyu derinden etkileyen eserlerinden biri olarak öne çıkıyor.&lt;/p&gt;

&lt;p&gt;Eserin baş karakteri Raif Efendi&;#39;nin Cumhuriyet&;#39;in ilk yıllarında Balıkesir Havran&;#39;daki baba evinden Almanya Berlin&;#39;e uzanan serüveni, orada âşık olduğu Maria Puder isimli kadınla bambaşka bir noktaya sürükleniyor. Sabahattin Ali Kürk Mantolu Madonna ile okuyucuyu ilk satırlarından itibaren yakalayıp, güçlü bir şekilde yansıttığı Türkiye ve Almanya&;#39;daki dönem atmosferinin içine çekiyor. Etkileyici psikolojik betimlemeleri, melankolik ve hüzünlü diliyle eser, geçmişten günümüze en sevilen romanlar arasındaki yerini koruyor.&lt;/p&gt;

&lt;p&gt;İlk baskısı 1943 yılında yapılan eserin 1998&;#39;den itibaren basımını Yapı Kredi Yayınları gerçekleştirmiştir.&lt;/p&gt;

&lt;p&gt;Kuyucaklı Yusuf Sabahattin Ali edebiyatının yetkin eserlerinden biri olarak epik anlatımı ve dönem atmosferini yansıtmadaki başarısıyla dikkat çekiyor. Öykü yazarlığı ile tanınan Ali&;#39;nin roman türündeki ilk eseri olan Kuyucaklı Yusuf, Osmanlı&;#39;nın son döneminde bir Ege kasabasında yaşanan olayları etkileyici bir anlatımla okura aktarıyor.&lt;/p&gt;

&lt;p&gt;Kuyucak köyünde ailesi eşkıyalar tarafından öldürülen küçük Yusuf&;#39;un olay yerini soruşturmaya gelen kaymakam Selahattin Bey tarafından evlat edinilmesiyle başlayan roman, Yusuf&;#39;un büyüyüp genç bir adam olarak kasaba yaşamıyla uyuşmayan ruhunu konu alıyor. Kaymakam Bey&;#39;in huzursuz ev ortamı, Yusuf&;#39;un üvey kardeşi Muazzez ile ilişkileri, kasabadaki egemen güçlerin zorba tavırları ve yaşanacak acı olaylarla Yusuf&;#39;un hayatını geri dönülmez bir noktaya taşıyor.&lt;/p&gt;

&lt;p&gt;İlk olarak 1937&;#39;de basımı yapılan eser, 1999 yılından itibaren Yapı Kredi Yayınları tarafından basılıyor.&lt;/p&gt;

&lt;p&gt;Türkiye&;#39;nin önemli sorunlarından birine parmak basan Metastaz Barış Terkoğlu ile Barış Pehlivan&;#39;ın müşterek kalemlerinden çıkan araştırma ve belgelere dayandırdıkları çalışmalarıdır. Son yıllarda yayınlanan politika kitapları arasında en çok ses getirenlerden biri olan Metastaz, okuyucunun yoğun ilgisini ilk baskısından bu yana korumaktadır.&lt;/p&gt;

&lt;p&gt;Yunanca, bir sonraki ve yer değiştirme anlamına gelen meta-statis kelimelerinden türeyen metastazın günümüzdeki kelime anlamı kanserli hücrelerin bulundukları dokudan başka bölgelere sıçrayarak yayılmalarıdır. Kitapta anlatılan konu ise bir kanser hücresi gibi devletin içine sızan, dini istismar ederek kullanan yasa dışı terör örgütü FETÖ ve diğer tarikat yapılanmalarıdır. Tek nefeste soluksuz okuyacağınız kitabı satın almak ve Türkiye&;#39;nin son 20 yılına damga vuran cemaat yapılarının iç yüzünü öğrenmek için alışverişe hemen başlayabilirsiniz. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Çocuklara, birlikte arkadaşça ve dostça yaşamayı öğreten Thomas ve Arkadaşları, artık hikaye kitabı olarak da sizlerle! Sodor Adası&;#39;nın meraklı, yaramaz fakat çok iyi kalpli treni Thomas, bu macerasında ekip çalışmasının ne olduğunu ve yardımlaşmanın önemini öğreniyor. &lt;/p&gt;

&lt;p&gt;Renkli illüstrasyonlarla dopdolu Thomas ve Arkadaşları-Ekip Çalışması, okuma deneyimini çizgi film deneyimiyle bir arada sunuyor ve çocukların eğlenerek öğrenmesini sağlıyor. Çocuklar, Thomas ve arkadaşlarının renkli maceralarına dahil oluyor ve onlarla birlikte ekip çalışmasını öğreniyor.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Özellikle okul öncesi yaş grubundaki çocukların çok sevdiği Thomas ve arkadaşlarının maceraları aynı zamanda öğretici hikayeleriyle çocuklara faydalı olmaya devam ediyor. Arkadaşlık kavramını, paylaşarak oynamayı ve değer vermeyi öğreten hikayelerle çocukları aynı zamanda eğlenceli bir yolculuğa çıkarıyor. &lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Çocuklar &;#39;&;#39;Sırayla Yapma&;#39;&;#39; Kavramını Thomas&;#39;la Öğreniyor&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;Birbirinden eğlenceli karakterlere sahip arkadaşları ve küçük bilge tren Thomas, çocuklara herhangi bir işi sırayla yapmanın önemini öğretiyor. Türlü maceralarla bazen başını belaya soksa da günün sonunda arkadaşlarıyla mutluluğunu paylaşan Thomas, başkalarının haklarına saygı duymayı ve paylaşmanın sevincini de çocuklara anlatmayı amaçlıyor. Okul öncesi etkinlik kitabı formatındaki Thomas ve arkadaşları - Sırayla Yapma kitabı sürekleyici hikayesi ve birbirinden farklı etkinlikleriyle çocuklarınızın ilgisini çekiyor.&lt;/p&gt;

&lt;p&gt;Eksik Parça Yayınevi&;#39;nin küçük okuyucularıyla buluşturduğu kitap, aynı zamanda faydalı hikayesiyle çocuklara yol gösteriyor.&lt;/p&gt;

&lt;p&gt;Eksik Parça Yayınları&;#39;ndan çıkan Thomas ve Arkadaşları Faydalı Hikâyeler okul öncesi etkinlik kitabı serisi çocuğunuzun sosyal hayata olumlu şekilde katılabilmesi için size yardımcı olacak eğitici öykülerden oluşur.&lt;/p&gt;

&lt;p&gt;Thomas ve Arkadaşları Paylaşma kitabı, pek çok çocuğun sevdiği bir çizgi kahraman olan Thomas’ın arkadaşlarıyla birlikte yaşadığı bir olay sonucu paylaşmanın önemi ve sağladığı faydalar hakkında edindiği tecrübeyi anlatır.&lt;/p&gt;

&lt;p&gt;Kitapta hikâyeyi görsel olarak zenginleştiren ve anlaşılmasını kolaylaştıran resimlere de yer verilir. Bir okul öncesi etkinlik kitabı olan Thomas ve Arkadaşları, çocukların keyifle dinleyebileceği ve anlayabileceği eğlenceli bir dilde yazılmıştır.&lt;/p&gt;

&lt;p&gt;Thomas ve Arkadaşları - Arkadaş Edinme kitabı çocuklara keyifli dakikalar yaşatıyor. Eğlenceli hikayesi ile çocukların ilgisini çeken kitap, arkadaş edinmenin ve sosyalleşmenin önemini aşılıyor. İletişim kurma becerisini geliştiren hikayesi ile Thomas ve Arkadaşları, çocukları macera dolu bir dünyaya taşıyor.&lt;/p&gt;

&lt;p&gt;Çocuklara kitap okumayı sevdiren Thomas ve Arkadaşları - Arkadaş Edinme kitabı, uyku saatlerini renklendiriyor. İlgi çekici hikayesi ile merak uyandıran kitap, 24 sayfadan oluşuyor. Karton kapağı ve rengarenk çizimleri ile çocukların hayal dünyasını genişletiyor. Okul öncesi, 6 ay ve 5 yaş arası çocuklar için uygun olan Thomas ve Arkadaşları, minikler için ilk eğitim kitapları arasında yer alıyor.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Mart 2019&;#39;da yayınlanan ve kısa sürede on binler satan Camdaki Kız kitabı, Dr. Gülseren Budayıcıoğlu tarafından Türk Edebiyatına kazandırıldı. Gülseren Budayıcıoğlu&;#39;nun sade anlatımıyla derin düşüncelere sürükleyen Camdaki Kız, zengin ve fakir ayrımını bir kere daha gözler önüne seriyor.&lt;/p&gt;

&lt;p&gt;Zengin kız ile fakir çocuğun aşk hikayesini ele alan Camdaki Kız, gerçek bir yaşam hikayesini ele alıyor. Bir yandan aşkın tadını aktaran diğer yandan aşk acısını okuyucuya sunan kitap, akıcı anlatımıyla ve sade diliyle okuyucusuyla bütünleşiyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Bakışınla Aydınlanır Dünya, arkadaşlık, dostluk, sevgi ve hüzün gibi konuların yer aldığı bir kitaptır. Yazar Susanna Tamaro, kitabında kendi hayat hikayesi hakkında da çarpıcı vurgular yapar. &lt;/p&gt;

&lt;p&gt;Susanna Tamaro, 16 yaşındayken geçirdiği trafik kazası sonucu engelli olan ve kanser sebebiyle yaşamını yitiren şair arkadaşı Pierluigi Cappello&;#39;yla olan derin arkadaşlık bağını kitabın sayfalarına taşır. Çocukluğundan başlayarak kendi hayatındaki olaylardan kesit halinde bahseder.&lt;/p&gt;

&lt;p&gt;Kitabı okuduğunuzda bazen bir günlük bazen de mektup okuyormuş hissine kapılabilirsiniz. Susanna Tamaro&;#39;nun kaleme aldığı Bakışınla Aydınlanır Dünya, kendi iç dünyanıza yolculuk etmenizi sağlayacak etkili bir eser.&lt;/p&gt;

&lt;p&gt;Şirin Proje Seti 4.Sınıfa Hazırım, Prof. Dr. Selçuk Şirin ve Derya Şirin tarafından hazırlanıyor. Çocukların 4. sınıfa geçişini kolaylaştırmak ve yetkinliğini geliştirmek için tasarlanan kitap, diğer ilkokul çocuk kitapları arasından yaratıcılığı ile sıyrılıyor. &lt;/p&gt;

&lt;p&gt;Test çözerek değil, araştırarak öğrenin mottosu ile yola çıkılan, 4 sınıfa hazırım Şirin proje seti ödev değil proje yapan çocuklar için özel. Türkçe, matematik, hayat bilgisi, güzel sanatlar, İngilizce dersleri için hazırlanan proje çalışmaları, her ders ile ilgili bilgilerin pekişmesine yardımcı oluyor. Kitap, Doğan Egmont Çocuk Kitapları tarafından basılıyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Pucca Günlük 7 - Peki Ya Şimdi? Pınar Selen Işık’ın Pucca günlük kitapları serisinin 7. kitabı olarak okuyucuların karşısına çıkıyor. 1987 yılında doğan yazar, Pucca günlüklerinde kendi hayatına yer veriyor.&lt;/p&gt;

&lt;p&gt;Pucca Günlük 7, aşktan ve yaşamdan yorulmuş ancak yine de her şeye komik yanından bakan Pucca’nın bir kere daha âşık olmasını ve bu aşkın evliliğe gidişini anlatıyor. “Yaşarken hiç komik değildi.” sloganı ile çıkan kitapta bu zamana kadar aşkı bulmaya çalışan Pucca, annelik serüveni esnasında yaşadığı olayların altından nasıl kalktığını okuyucularıyla paylaşıyor.&lt;/p&gt;

&lt;p&gt;Pek çok kadının Pucca Günlük 7’de kendini bulacağı bir okuma deneyimine hazır olun.&lt;/p&gt;

&lt;p&gt;Lol Süper Havalı Faaliyet Kitabı ile çocuklar keşfetmenin keyfini yaşıyor. Öğrenmeyi keyifli hale getiren faaliyet kitabı, çocukların zihinsel gelişimine katkı sağlıyor. Kitabın içinde bulunan 100 adet rengarenk çıkartma ile çocukların hikaye kurma becerileri ve hayal dünyası gelişiyor.&lt;/p&gt;

&lt;p&gt;Birbirinden eğlenceli zeka oyunlarının ve bulmacaların yer aldığı Lol Süper Havalı Faaliyet Kitabı, renkli tasarımı ile çocukların beğenisini topluyor. Lol Suprise karakterlerinin sevimli ve ayrıntılı çizimleri miniklerin ilgisini çekiyor. 16 sayfadan oluşan kitap, 6 ve 10 yaş arası çocuklar için faydalı bir aktivite sunuyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Uykudan Önce Karmakarışık Maksimus&;#39;un Uyku Saati, okul öncesi yaştaki çocukların uykuya hazırlık sürecine eğlence katıyor, çocukların küçük yaşlardan itibaren kitap okuma alışkanlığı edinmelerine yardım ediyor. Çocukların hayal gücünü genişleten kitap, sürükleyici olay örgüsü sayesinde çocukların uykuya dalışını kolaylaştırıyor, neden - sonuç ilişkisini öğrenmelerini sağlıyor ve ebeveynleriyle kaliteli bir zaman dilimi geçirmelerine aracı oluyor. &lt;/p&gt;

&lt;p&gt;Okul öncesi etkinlik kitabı, Disney çizgi filmlerindeki tanıdık karakterlerin yer aldığı eğlenceli bir öyküden oluşuyor. Rapunzel ve Flynn&;#39;in cesur saray muhafazı Maksimus&;#39;u uyumak için ikna etme sürecine çocukları da dahil ederek keyifli bir uykuya hazırlık saati sunuyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Robert Louis Stevenson&;#39;ın ünlü romanı Define Adası, artık klasikler arasında yer alıyor. Stevenson&;#39;ın ilk kez 1881 yılında yayınlanan Define Adası kitabı, heyecanlı kurgusu nedeni ile yetişkinlerin de beğendiği kitaplar arasında. Romanın ana kahramanı Jim Hawkins&;#39;in ağzından anlatılan Define Adası Stevenson için korsanların büyülü dünyasını işlemekten de öte bir anlam taşıyor.&lt;/p&gt;

&lt;p&gt;Define avına çıkan korsanların maceralı yolculuklarının hikaye edildiği roman, gerek anlatımı gerek ise sürükleyici öyküsü sayesinde bugün dahi okuyucuların ilgisini çekmeyi başarıyor. Okumayı sevdirecek türden kitaplar arasında sayılan ve artık klasikleşmiş romanı, alışveriş sepetinize ekleyebilir, kendinize ya da sevdiklerinize hediye etmek için satın alabilirsiniz. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Cihad Kök&;#39;ün 8. kitabı olan Konuşmamız Gereken Şeyler Var, hayatı ve insanların yaşayış biçimleri irdeleyen, kişisel gelişim türünde hazırlanmış bir kitap. Arunas Yayıncılık tarafından 2019 yılında basımı gerçekleştirilen kitap, 176 sayfadan oluşuyor. &lt;/p&gt;

&lt;p&gt;Dünyayı bir çocuk bakış açısıyla sorgulayan yazar, bu kitabında insanların hayata karşı olumsuz bakış açılarını değiştirecek bir dil kullanıyor. İnsanların çevresinin ne söylediğinden çok kendi sesini dinlemesi gerektiği, bu şekilde mutluluğu bulabileceği kitabın ana metnini oluşturuyor. Olumsuz olaylara karşı kişilere tavsiye vermekten çok onları motive eden bir dili içeren kitap, psikoloji ve felsefe türleriyle ilgilenen okuyucular için iyi bir alternatif sunuyor.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Karakteri Değiştirmek Rıchard J. Davıdson Danıel G tarafından yazılan, kişisel gelişim alanındaki başarılı kitaplardan birisidir. Meditasyonun zihin, beyin ve beden üzerindeki etkisini anlatan kitap, bilimsel bir bakış açısı sunar. Yazdıkları kitaplar ile dünya çapında tanınan ve psikoloji alanında uzman iki doktorun yazdıkları kitap beynin aslında ne kadar kompleks bir yapı olduğunu anlatır.&lt;/p&gt;

&lt;p&gt;Karakteri Değiştirmek Daniel Goleman ile Richard Davidson’un hayatınızın üzerinde ne kadar fazla kontrol sahibi olabileceğinizi sade bir şekilde anlattıkları kitapları olup, yaşantınızı yoluna koymanızda size yardımcı olabilir.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Turlingham Akademisi&;#39;nde yatılı olarak okumayan tek kız Sophie ve elbette bu durum Sophie için hiç kolay değil. Çünkü Sophie bazen dışlanmış olduğunu düşünmekten kendini alıkoyamıyor. Sophie tüm gece eğlencelerini ve dedikodularını kaçırmaktan şikâyet ederken okula yeni öğrenci Katy gelir. Ve Katy’nin gelmesi ile Sophie arkadaşlarının büyülendiğini hisseder.&lt;/p&gt;

&lt;p&gt;Katy cadı değil ama Turlingham Akademisi&;#39;nde bir cadı olduğunu biliyor. Cadı avcısı olan Katy’nin akademiye geliş amacı o cadıyı bulup, gizli büyüyü durdurmak! Sophie ise her şeyi eski haline döndürmek ve Katy’i hayatından çıkarmak için bu süreçte kendini Katy’e yardım ederken buluyorr. Fakat artık hiçbir şey eskisi gibi olmuyor.&lt;/p&gt;

&lt;p&gt;Ellie Boswell tarafından yazılan ve Artemis Yayıncılık etiketiyle basılan, 196 sayfalık fantastik seri arkadaşlık ve aileye dair sevgi dolu bir hikâye ile okuyucusuyla buluşuyor.&lt;/p&gt;

&lt;p&gt;En büyük Türk şairlerinden Nazım Hikmet’in hayat hikayesi bu kez çocuklar için yazıldı. Erdoğan Oğultekin tarafından kaleme alınan Nazım Hikmet’in Memleketi, çocuklarınızın Nazım Hikmet’i tanımasına vesile olacak. Resimli hikayelerle süslenen Nazım Hikmet’in Memleketi, çocuklarınıza alabileceğiniz en güzel hediyelerden birisi. Kitap, Nazım Hikmet’in memleket sevgisi, özlem, umut ve mücadele dolu yaşamını çocuklarınızın anlayabileceği bir dille onlara aktarıyor. Şiirleri tüm dünyada okunan Nazım Hikmet’i çocuklarınızla tanıştırmak için geç kalmayın. Yalın anlatımı sayesinde bir çırpıda okuyup bitirecekleri kitap, çocuklarınıza çok şey katacak. &lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Ürün Özellikleri&lt;/strong&gt;&lt;/p&gt;

&lt;ul&gt;&lt;li&gt;Yayınevi: Eksik Parça&lt;/li&gt;&lt;li&gt;Basım Tarihi : Eylül 2019&lt;/li&gt;&lt;li&gt;Sayfa Sayısı : 32&lt;/li&gt;&lt;/ul&gt;

&lt;p&gt;Kadına dair pek çok hikayeyi barındıran Issız Kadınlar Sokağı, Canan Tan tarafından kaleme alınmıştır. Kitaptaki olaylar; şiddet, tecavüz ve taciz mağduru 20 kadının hikayesi etrafında şekillenmektedir. Daha önce Issız Erkekler Korosu kitabıya ezilen erkeklerin hikayelerini anlatan Canan Tan, Issız Kadınlar Sokağı ile de sesi duyulmayan birçok kadının hikayesini anlatmaktadır.&lt;/p&gt;

&lt;ul&gt;&lt;li&gt;Issız Kadınlar Sokağı, toplamda 144 sayfadan oluşmaktadır.&lt;/li&gt;&lt;li&gt;Karton kapağa sahip olan kitabın boyutları 13.5 x 19.5 santimetredir.&lt;/li&gt;&lt;li&gt;Öykü türünde yer alan kitabın ilk basımı, Ekim 2019&;#39;da gerçekleşmiştir.&lt;/li&gt;&lt;li&gt;Kitabın yayınevi Doğan Kitap&;#39;tır.&lt;/li&gt;&lt;/ul&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Stem Macerası Yarış kitabı, eğlenirken öğrenmeyi amaçlayan okul öncesi ve ilkokul çağındaki çocuklara hitap ediyor. Yarış başlığı altında toplanan konuları STEM Eğitim Sistemi&;#39;ne göre inceleyen Stem Etkinlik Kitabı, adrenalin dolu farklı yarış türleri ve bu yarışlarda kullanılan araçları fen, teknoloji, mühendislik ve matematiğin renkli ve eğlenceli bakış açısıyla öğretmeyi amaçlıyor.&lt;/p&gt;

&lt;p&gt;İsmini Fen (Science), Teknoloji (Technology), Mühendislik (Engineering) ve Matematik (Mathematics) bilimlerinin baş harflerinden alan STEM Eğitim Sistemi, okul öncesinden itibaren tüm çocuklara farklı şekillerde düşünmeyi ve yeni çözümler üretmenin yollarını öğretmeyi amaçlıyor. Öğrenilen bilgilerin gerçek hayatta da karşılığının olduğunu vurgulayan bu eğitim sistemi, öğrenilen teorik bilgileri günlük hayattaki deneyimlerle pekiştirerek her yaştan çocuk için kalıcı öğrenmenin yolunu açıyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Frozen oyunlu masallar ürünü ile çocuğunuzun favori kahramanlarından olan Karlar Ülkesi Prensesi Elsa ve diğer karakterlerle keyifli vakit geçirmesini sağlayabilirsiniz. Frozen oyunlu masallar çeşitli oyunlara sahip olan masalları sayesinde çocuklarınızın hayal gücünün gelişimine katkıda bulunur. Frozen oyunlu masallar çocuklarınızın en sevdiği sinema karakterlerini bir araya getirerek onlarla farklı oyunlar oynamasını sağlar.&lt;/p&gt;

&lt;p&gt;Frozen&;#39;ın sevilen karakterleri Elsa ve Anna&;#39;nın maceralarına devam ettikleri Frozen oyunlu masallar ürünü, çocuklarınızın heyecanla beklediği hikayeyi keyifli bir şekilde konu ediyor. Buzlar Ülkesi&;#39;nin sımsıcak maceralarını evlerinize davet ederek eğlenceli vakitler geçirebilirsiniz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Frozen Boyama Kitabı; çocukların çok sevdikleri Disney Karlar Ülkesi karakterlerinden oluşur. Elsa, Anna, Hans ve diğer Disney Frozen hikayelerini konu alan boyama kitabı, çocukların keyifle boyama yapmalarını sağlar. Çocukların motor becerilerine katkı sağlayan ve estetik anlayışlarını güçlendiren kitap özellikle kız çocukları tarafından çok sevilir.&lt;/p&gt;

&lt;p&gt;Çocuklar, Karlar Ülkesi karakterlerini, şatolarını ve aksesuarlarını ister orijinal renklerine bağlı kalarak isterlerse kendi hayal güçleriyle değiştirerek boyayabilir. Yolculuklarda, kafe ve restoranlara giderken de Frozen boyama kitabını yanınızda taşıyabilirsiniz. Bu sayede çocuklarınız gittiğiniz yerlerde sıkılmadan vakit geçirebilirler.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Bilim Okulu Proje X Damla Kunç Koçman tarafından yazılmış bir kitap olup çocuklar ve gençlere bilimi sevdirmeyi amaçlar. Dünyanın en güzel bölgelerinden birisinde kurulan bilim okulu yalnızca çok özel sınavlardan geçen zeki ve yetenekli öğrencileri kabul eder. Kitabın ana karakterleri olan Gül ile Can da bilim okuluna kabul edilen öğrencilerdendir.&lt;/p&gt;

&lt;p&gt;Can ve Gül’ün hikâyesini konu alan kitapta iki karakterin birbirinden ne kadar farklı olduğu anlatılır. Ancak birbirinden pek de hoşlanmayan öğrenciler bir projede bir araya gelmek durumunda kalır. İkilinin proje esnasındaki birlikteliklerini konu alan kitap yalın bir anlatıma sahip olup gençler tarafından rahatlıkla okunabilir.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Dc-Bir Kahramanın Doğuşu, Wonder Women serisinin sürükleyici bir çocuk kitabı. Artemis Çocuk Yayınları aracılığıyla okurla buluşan eser, süper kahramanlar dünyasının ender kadın karakterlerinden birinin doğuşunu anlatıyor.&lt;/p&gt;

&lt;p&gt;Özellikle kız çocuklarına alınabilecek en güzel hediyelerden biri olan kitap, prenses olarak büyüyen ve dünya barışını sağlamak için süper kahramana dönüşen kadını konu alıyor. &lt;/p&gt;

&lt;p&gt;Oyunlar, aktiviteler ve boyamalarla kahramanın doğum gününü kutlayan kitap, DC’nin bütün kahramanları gibi çocukları da maceraya ve eğlenceye davet ediyor. Kız çocuklarına kadınların başarı hikayelerinden, kahramanlıklarından bahsetmek isteyen ebeveynler kitaplıklarında Wonder Women&;#39;a yer açıyor. &lt;/p&gt;

&lt;p&gt;Kaybolan Şimşek Gibi, Ada Palmer tarafından kaleme alınan bilim-kurgu serisi Terra Ignota&;#39;nın ilk kitabı olma özelliği taşıyor. 2020 yılında Eksik Parça Yayınevi etiketiyle raflarda yerini alan eser, toplam 632 sayfadan oluşuyor. Bu eseriyle 2017 yılında John W. Campbell En İyi Yeni Yazar Ödülü&;#39;ne layık görülen Ada Palmer, insanlığın alışılmadık dinamiklerle yönetildiği bir evren yaratıyor. Kaybolan Şimşek Gibi&;#39;nin çevirmenliğini ise Ilgın Yıldız üstleniyor.&lt;/p&gt;

&lt;p&gt;Kaybolan Şimşek Gibi, &;#34;Yedi Hizip&;#34; ve Kovan&;#34; isimlerini taşıyan iki farklı yönetici güç tarafından domine edilen bir dünyada geçiyor. Sözleşmeli bir köle olarak çalışan baş karakter Mycroft, üstlerinden aldığı bir talimat ile bir hırsızlık olayının peşine düşüyor. Söz konusu hırsızlık, Kovan&;#39;lar tarafından uzun yıllar önce kurulmuş bir komplonun kapılarını aralıyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Gökyüzü Herkesindir Zülfü Livaneli imzasıyla, özel yetişkin kitapları kategorisinde bulunuyor. Livaneli&;#39;nin kaleme aldığı şiirlerin derlendiği kitap, Abidin Dino&;#39;nun desenleri ile süsleniyor. Doğan kitap tarafından yayımlanan eser, &;#34;hep bir ağızdan türkü söyleyen” bir halkın sesi olan Zülfü Livaneli&;#39;nin dizelerini sevenlerine sunuyor. &lt;/p&gt;

&lt;p&gt;&;#34;Gökyüzü senindir, gökyüzü herkesindir&;#34; dizeleriyle umut aşılayan yazar, dünyayı güzellik kurtaracak diyenlerin buluşma noktası oluyor. 2020 yılında okurlara ulaşan kitap, edebi eserleri, romanları, şarkıları ile tanınan Livaneli&;#39;nin şiirlerine ev sahipliği yapıyor. Eser, 108 sayfadan oluşuyor. Eserleri, bugüne dek onlarca dile çevrilen yazar, farklı ülkelerden birçok ödülün de sahibi. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Çocuklar için Kodlama Oyunları kitabı, çocuğunuzun düşünme yeteneğini arttırmaya yardımcı olurken, dikkatinin gelişmesine de katkıda bulunur.&lt;/p&gt;

&lt;p&gt;Eğitimde farklı disiplin sistemlerin bir arada kullanıldığı, fen, mühendislik, teknoloji, matematik ve sanatı birleştiren STEM-A sistemine göre tasarlanan Kodlama Oyunları kitabı 7 yaş ve üzeri için uygundur. Çocuklara bilimi ve teknolojiyi sevdirmeyi hedefleyen bu kitapta kodlama oyunlaştırılarak öğretilir.&lt;/p&gt;

&lt;p&gt;Kitapta mantık bulmacalarından, teknolojik, sanatsal, sosyal kod dillerine, nonogram çalışmalarından, algoritma alıştırmalarına, şifre oyunlarından mantık bulmacalarına pek çok farklı aktivite yer alır. Kodlama Oyunları kitabı, gelecek vaat eden çok önemli bir beceri olan kodlama yapmayı öğretmek için çocuklara eğlenceli bir başlangıç sunar.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Okul öncesi çağdaki küçüklere mutluluk veren ve onların hayal güçlerini zenginleştiren çizimleri, diledikleri şekilde renklendirebilmelerini sağlayan Eğlenceli Boyama 4 Çeşit, Boyama Kitapları kategorisi içerisinde yer alıyor.&lt;/p&gt;

&lt;p&gt;Çocuklar için özel yayınlar hazırlayan Eksik Parça Çocuk tarafından yayımlanan ve ilk baskısını 2020 yılında yapan Eğlenceli Boyama 4 çeşit, 1. hamur kâğıt baskısıyla beğeni topluyor.&lt;/p&gt;

&lt;p&gt;Toplam 48 sayfadan oluşan ve karton kapağıyla küçüklerin diledikleri gibi yanlarında taşımalarına rağmen yıpranmaya uğramayan kitap, çocuklarının, boş vakitlerini verimli şekilde değerlendirebilmesini arzu eden ebeveynlerin alışveriş listelerine giriyor.&lt;/p&gt;

&lt;p&gt;Kral Şakir 8 Macera Adası, Varol Yaşaroğlu tarafından yaratılan bir çizgi karakter olan Kral Şakir&;#39;in yepyeni maceralarını konu alıyor. İlk olarak Cartoon Network&;#39;te yayımlanan ve ilk Türk çizgi dizisi olarak dikkat çeken Kral Şakir, küçük izleyicilerden gördüğü büyük ilgi sonucunda kitaplarda da hayat buluyor.&lt;/p&gt;

&lt;p&gt;Kral Şakir serisinin sekizinci kitabı olan Macera Adası, toplam 208 sayfadan oluşuyor. 2020 yılında Eksik Parça Çocuk Yayınları etiketiyle raflarda yerini alan eser, ciltli bir baskı olma özelliği taşıyor.&lt;/p&gt;

&lt;p&gt;Kral Şakir 8 Macera Adası kitabında daha önce hiçbir yerde yayımlanmamış iki yeni macera yer alıyor. Kral Şakir ve arkadaşları bu iki öyküde Kars&;#39;a ve Lömpen Adası&;#39;na ulaşmaya çalışıyor. Elbette her macerada yanlarında olan Fil Necati&;#39;nin haylazlıkları, yolculuğu herkes için daha zor bir sürece dönüştürüyor. &lt;/p&gt;

&lt;p&gt;Yazar Mustafa Ünver&;#39;in çocuklar için kaleme aldığı Durutti Durutti - Duru&;#39;nun Tatil Günlükleri kitabı Eksik Parça Yayınları&;#39;ndan çıkıyor. Erdoğan Oğultekin&;#39;in çizimleriyle renklenen kitap, çocukların severek okuyabileceği keyifli maceralar sunuyor.&lt;/p&gt;

&lt;p&gt;Duru adında küçük bir kızın ailesi ile birlikte yaşadığı serüvenler kitabın konusunu oluşturuyor. Duru bu macerasında Dalyan&;#39;a gidip nesli tükenmekte olan caretta caretta kaplumbağalarıyla tanışıyor. &lt;/p&gt;

&lt;p&gt;Çocukların hayal dünyasına hitap eden, eğitici geliştirici bir çocuk kitabı olan Durutti Durutti 40 sayfadan oluşuyor. Çocukların sıkılmadan ve merak ederek okuyacağı kitabı onlar için bir tatil hediyesi olarak tercih edebilirsiniz.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Sevilen yazar Nermin Bezmen&;#39;in yeni romanı Unutkan Aşk, Doğan Kitap tarafından yayınlanıyor. Kitap, aşk üzerine okuru sıra dışı bir serüvene çıkarıyor.&lt;/p&gt;

&lt;p&gt;Unutkan Aşk odağına alzheimer hastalığını alıyor. Başarılı bir kadın yazar Maya ile sanatçı eşi Atlas&;#39;ın tutkulu aşklarının üzerine çöken alzheimer illeti romanın konusunu oluşturuyor. Güçlü ve incelikle işlenmiş karakterleri ile bir aşkın hastalıkla olan mücadelesini etkileyici bir dille okura aktarıyor.&lt;/p&gt;

&lt;p&gt;Aşka, zorlu bir hastalık süreci üzerinden edebi bir bakış bırakan Unutkan Aşk, hem Nermin Bezmen okurları hem de yazarı keşfetmek isteyenler için keyifli bir okuma seçeneği sunuyor.&lt;/p&gt;

&lt;p&gt;Altın Portakal en iyi senaryo ödülüne layık görülen polisiye filmi İtirazım Var&;#39;ın ana karakteri Selman Bulut, maceralarına Hesabım Var&;#39;da devam ediyor. Onur Ünlü&;#39;nün kaleme aldığı romanda okuyucu, Selman karakterinin renkli hayatıyla buluşuyor.&lt;/p&gt;

&lt;p&gt;Selman Bulut, imamlığını yaptığı camide yaşanan korkunç cinayeti tek başına aydınlatıyor. Ancak, her şey beklediği gibi gitmiyor ve katilin, kızı Zeynep&;#39;in müstakbel eşi olduğunu öğreniyor. Zeynep, bu durumu atlatamayıp akıl hastanesine gönderiliyor. Olayın ardından Selman Bulut, daha fazla imamlık yapamayarak zorunlu istifasını vermek zorunda kalıyor. Maceralar, yoldaşı Efrahim&;#39;le beraber Laleli&;#39;de bir pavyonda çalışmaya başlayan Selman Bulut&;#39;un peşini yeni hayatında da bırakmıyor.&lt;/p&gt;

&lt;p&gt;Alfa Yayınları&;#39;ndan çıkan Hesabım Var, 352 sayfalık bir serüven. Onur Ünlü, ilk cümlesinden itibaren sizi sürprizlerle dolu bir yolculuğa çıkarıyor. &lt;/p&gt;

&lt;p&gt;Anı ve biyografi türündeki Ah Be Alexander, Hakan Konakçı&;#39;nın yayımlanan ilk kitabı olarak satışa sunuluyor. Kitap, çocukları sinir sistemini etkileyen genetik bir rahatsızlığa yakalanan ailenin yaşadığı zorlu süreçleri ele alıyor.&lt;/p&gt;

&lt;p&gt;Tedavisi bulunamamış bir hastalığa karşı verilen gerçek mücadele ve umuda tutunma çabasını duygusal bir dille anlatan eser, benzer sorunları yaşayan kişilere her sayfada manevi açıdan destek oluyor.&lt;/p&gt;

&lt;p&gt;Doğan Kitap Yayınları tarafından basılan 168 sayfalık eser, gerçek hikayesi, samimi ve duygusal ifadeleriyle okuyucusuna şartlar ne olursa olsun iyimser kalmayı öğütlüyor. Yaşanılan tüm zorluklara karşı güçlü kalmanız için bu eseri mutlaka okumalısınız.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Okul öncesi yaşlardaki çocukların yepyeni bilgileri, son derece eğlenceli şekilde öğrenebilmelerine yardım eden kitap serisi Küçük Tavşancık - Rasa Dmuchovskie, Boyama, Aktivite kategorisi içerisinde yer alıyor.&lt;/p&gt;

&lt;p&gt;İçerisinde bulunan çıkartmalar sayesinde küçüklerin, kitap içerisindeki olaylara kendilerinin de dâhil olabilmelerini sağlayan ürünler; sayı, renk, gün içerisindeki aktiviteler, tatil, kavramlar gibi birçok konu çerçevesinde tasarlanıyor.&lt;/p&gt;

&lt;p&gt;Küçük Tavşancık - Rasa Dmuchovskie tarafından hazırlanırken kitapları Türkçeye İdil Ademir uyarlıyor. 1. hamur kâğıda basılan ve ciltsiz olarak sunulan kitaplar, 12 sayfadan oluşuyor. Ebeveynlerin alması önerilen seri, çocukların gelişimine katkıda bulunabiliyor.&lt;/p&gt;

&lt;p&gt;Cem, efsanevi kahraman Herkül’le tanışır. Herkül’ün beceriksizlikleri, Cem’in evinin karışmasına neden olur. Vakit kaybetmeden Antik Yunan’a geri dönmesi gereken Herkül’e yardım edebilecek tek kişi Cem’dir. İki kafadarı eğlenceli maceralar beklemektedir.&lt;/p&gt;

&lt;p&gt;İşte Herkül Geliyor 1 Stella Tarakson tarafından kaleme alınıyor. Mizahi bir dille yazılan 184 sayfa uzunluğundaki kitap, çocukları komik ve heyecanlı bir serüvene davet ediyor.&lt;/p&gt;

&lt;p&gt;The Çocuk Yayınevi tarafından 2020 yılında yayınlanan öykü / masal türündeki İşte Herkül Geliyor! - Cesur Cem ve Beceriksiz Kahramanlar 1, çocukları mitolojik karakterlerle tanıştıran bir serinin ilk kitabı olma özelliği taşıyor.&lt;/p&gt;

&lt;p&gt;Cesur Cem serisinin ikinci kitabı olan Hera&;#39;nın Korkunç Tuzağı, macera meraklısı Cem&;#39;in Antik Yunan dönemine yaptığı yolculuğu anlatıyor. Büyülü biz vazoyla başlayan fantastik keşifleri çocuklara uygun bir dille anlatan kitap, hayal gücünün sınırlarını zorluyor.&lt;/p&gt;

&lt;p&gt;Stella Tarakson tarafından yazılan, Türkçe&;#39;ye Görkem Bir tarafından çevrilen eser 184 sayfadan oluşuyor. Çocukların okuma alışkanlığı edinmesini kolaylaştıran içeriği, kitapların sevdirilmesi konusunda iyi bir başlangıç seçeneği sunuyor. &lt;/p&gt;

&lt;p&gt;Cem ve arkadaşlarıyla Antik Yunan topraklarında çıkacağınız bu yolculuk, sayfalar arasında eğlenceli ve bilgilendirici anlar yaşayacağınız unutulmaz dakikalara eşlik etmeniz için sizi bekliyor. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Bilimsel konular ve teknolojideki gelişmeleri merak edenlerin severek okuduğu Bilim Teknik dergisi, gazete ve dergi reyonunun en ilgi çeken dergilerden biri.&lt;/p&gt;

&lt;p&gt;1967 yılından beri her ay Türkiye Bilimsel ve Teknolojik Araştırma Kurumu&;#39;nun çıkardığı derginin içeriği, teknoloji ve bilim alanındaki gelişmeleri herkesin anlayabileceği bir dilde hazırlanıyor. Gençleri bilimsel ve teknolojik araştırma alanlarına yönlendirmeyi amaçlayan dergi, yetişkinler tarafından da oldukça fazla ilgi görüyor. Sağlık, teknoloji, psikoloji, sosyal bilimler, uzay - fizik ve çevre - enerji gibi geniş bir yelpazede ufkunuzu açacak dosya konularını Bilim Teknik&;#39;te bulabilirsiniz. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;&lt;b&gt;Bebeğim ve Biz&lt;/b&gt; her ay yayınlanan aile bireylerinin yakından takip ettiği &lt;b&gt;çocuk&lt;/b&gt;, &lt;b&gt;gebelik ve doğum&lt;/b&gt;, &lt;b&gt;aile ilişkilerini&lt;/b&gt; içeren &lt;b&gt;dergi&lt;/b&gt;dir.&lt;/p&gt; 
&lt;p&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;Üstelik Bebeğim ve Biz, &lt;b&gt;hamileler için&lt;/b&gt; tavsiyelerle birlikte kişileri &lt;b&gt;anne baba olmaya &lt;/b&gt;zihinsel olarak da hazırlamaya yardımcı olacak ve içerisinde her ay güncelenen röportajlar size faydalı fikirler sunacaktır.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;/p&gt; 
&lt;p&gt;&lt;b&gt;Bebeğinizin sağlığından, zeka gelişiminden, mamalarının seçimi&lt;/b&gt;ne kadar tüm yanıtlar Migros Sanal Market’de Bebeğim ve Biz&lt;b&gt;’&lt;/b&gt;de. Üstelik &lt;span&gt;tek tıkla online sipariş verebilir, ödemeyi online ya da&lt;b&gt; &lt;/b&gt;kapıda kredi kartı ile gerçekleştirerek aynı gün teslim alabilirsiniz.&lt;/span&gt;&lt;/p&gt;

&lt;b&gt;Bilim Teknoloji&lt;/b&gt;, okuması keyifli bir dergidir.
&lt;br /&gt;
&lt;br /&gt;Bilim ve teknoloji dünyasındaki gelişmeler, icatlar, yenilikler, keşifler ilginizi çekiyorsa bu dergiyi alıp vizyonunuzu genişletebilirsiniz.
&lt;br /&gt;
&lt;br /&gt;Bilim Teknoloji Dergisi, çocuklar için de çok keyifli bir okuma saati sunar. Özellikle boş zamanlarında, tatilde Bilim Teknoloji Dergisi okuyarak, bilime, araştırma yapmaya, okumaya ilgi duyabilirler.
&lt;br /&gt;
&lt;br /&gt;Bilim Teknoloji ürününü Migros Sanal Market';in
&lt;b&gt; Gazete, Dergi &lt;/b&gt;reyonundan satın alabilir, tek tıkla online sipariş verebilir, ödemeyi 
&lt;b&gt;online olarak ya da kapıda kredi kartı&lt;/b&gt; ile gerçekleştirebilir, ürününüzü aynı gün içinde teslim alabilirsiniz.

