 &lt;b&gt;Fox Fitness Sayaçlı El Yayı&lt;/b&gt;, kol ve bilek kaslarını güçlendirmek üzere dizayn edilmiştir. Sayaçlı yapısı sayesinde egzersiz programınızda kolaylık sağlar. 
