&lt;b&gt;Leva Çelik Çöp Kovası 5 lt.&lt;/b&gt;, pedallı yapısı sayesinde kolaylıkla açıp kapatılır. Şık ve sade bir tasarıma sahiptir. 
&lt;br /&gt;
&lt;br /&gt;Paslanmaz çelik, 5 lt.';ilk kapasitesi ile banyo ve mutfaklarda kullanıma uygundur.

&lt;b&gt;Leva Çelik Çöp Kovası 12 lt.&lt;/b&gt;, pedallı yapısı sayesinde kolaylıkla açıp kapatılır. Şık ve sade bir tasarıma sahiptir. 
&lt;br /&gt;
&lt;br /&gt;Paslanmaz çelik, 12 lt.';ilk kapasitesi ile geniş ailelerin kullanımına uygundur.

&lt;b&gt;Leva 3';lü Kristal Elbise Askısı&lt;/b&gt;, kristal parlaklığında zarif bir tasarıma sahiptir. Elbiseler, gömlekler, pantolonlar için uygundur. 
&lt;br /&gt;
&lt;br /&gt;Giyeceklerinizi ütüsü bozulmadan dolapta tutmak için katlamak yerine askı üzerine yerleştirmeniz önerilir.

&lt;b&gt;Dünya Plastik Şampuanlık Raf&lt;/b&gt;, farklı ebatlarda 3 ayrı raf ve kancaları ile pek çok eşyanızı bir seferde depolayabilir. 
&lt;br /&gt;
&lt;br /&gt;Plastik yapısı sayesinde kırılma, paslanma gibi sorunlar yaratmaz. Banyo içinde kullanıma uygundur.

&lt;b&gt;Jolly Çocuk Basamağı&lt;/b&gt;, mutfak ya da banyoda çocukların lavaboya erişebilmesi için tasarlanmış mini basamaktır. 
&lt;br /&gt;
&lt;br /&gt;Çok yüksek olmayışı ve silikon, kaymaz tabanlı ayakları sayesinde güvenle kullanılabilir.

&lt;p&gt;Banyonuza modern ve şık bir görünüm kazandıran Leva Seramik Sabunluk Seti, sıvı sabunluk, katı sabun tabağı ve diş fırçalık tasarımlarından oluşuyor. Seramik sabunluk seti, beyaz ve gold rengi detayları ile naif bir görünüm taşıyor. Sıvı sabun için tasarlanmış pompalı seramik şişe, pratik kullanımı ile öne çıkıyor. &lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Zarif ve Kullanışlı Tasarım&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;Ürün, 3 parçalı kullanışlı ve zarif tasarımı ile banyonuzun atmosferine modern bir dokunuşta bulunuyor. Leva seramik sabunluk modelinin beyaz renk ile tasarlanmış olması, mavi, lacivert, pembe, siyah, kırmızı gibi birçok farklı renge sahip banyo dekorasyonlarında kullanılmasına imkân sağlıyor. &lt;/p&gt;

&lt;p&gt;Temizlik yaparken en fazla kullanılan araç gereçlerin başında su kovaları gelir. Su kovaları, şekil, renk, üretiminde kullanılan materyal, kova yüzeyi, su hacmi ve dayanıklılık gibi özellikleriyle temizlik yapan kişiye birçok konuda kolaylık sağlar. &lt;/p&gt;

&lt;p&gt;Leva Şeffaf Su Kovası 19,5 L kapasitesi ile geniş su hacmine sahiptir. Şeffaf dokusuyla Leva plastik su kovası kullanırken içerisindeki su veya diğer sıvıları rahatlıkla görebilirsiniz. Bu sayede içerisindeki suyu doğru zamanda değiştirebilirsiniz. &lt;/p&gt;

&lt;p&gt;Ergonomik taşıma sapına sahip Leva Şeffaf Su Kovasının yüzeyindeki girintiler, içerisindeki suyu boşaltırken kavrama imkânı verir. &lt;/p&gt;

&lt;p&gt;Lerato Tekerlekli Raflı Giysi Askılık, mekandan tasarruf yapmanızı sağlayacak işlevsel ve kaliteli bir üründür. &lt;strong&gt;Ayaklı askılık&lt;/strong&gt; üzerine, gömlek, pantolon, elbise, kaban ve mont gibi giysilerinizi asabilir; dilerseniz portmanto dilerseniz açık elbise dolabı şeklinde çok yönlü olarak kullanabilirsiniz. Askının alt tarafında bulunan bölüme ise ayakkabı veya çantalarınızı yerleştirebilirsiniz. &lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Tekerlekli elbise askısı &lt;/strong&gt;bir mekana bağlı olmaksızın eviniz yahut ofisiniz içerisinde ihtiyaç duyduğunuz noktaya kolaylıkla taşınabilir. Giysilerin yüksekliğine göre teleskopik olarak ayarlanabilen dört &lt;strong&gt;tekerlekli askılık, &lt;/strong&gt;tek askılı bir boru şeklindeki asma aparatına sahiptir. Demonte olarak teslim edilen ürün, hafif ve kolay kurulumlu olup; kurulumu için ekstra bir alete ihtiyaç yoktur.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Leva 24&;#39;lü Soft Mandal seti, çamaşır asarken sizlere yardımcı olur. Çamaşırları iplere güvenle asmanızı sağlayan mandallar sayesinde kumaşlar düşmeden asılı kalabilir. Mandallar, rüzgar gibi dış etkenlere karşı çamaşırlara ve ipe sıkıca tutunur.&lt;/p&gt;

&lt;p&gt;Set içinde 24 adet mandal yer alır. Bu sayede geniş bir çamaşır makinesinden çıkan çamaşırlar bile tek seferde kurutulabilir. Plastik mandallar içinde bulunan yay sayesinde zahmetsizce açılıp kapanır. Mandalları tek elle toplayarak yeniden kullanmak üzere bir sepette muhafaza edebilirsiniz. Plastik yapısı sayesinde uzun süre kullanılabilen ürünler, kirlendiğinde silinerek temizlenebilir. &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Deprem Çantası Acil Durum Kiti, deprem anında gerekli olabilecek malzemeleri içeren kapsamlı bir set sunuyor. 12 üründen oluşan sette, ilk yardım malzemeleri ve yaşamsal gereçler bulunuyor.&lt;/p&gt;

&lt;p&gt;İçinde; düdük, dinamolu el feneri, işçi eldiveni, iki adet toz maskesi, kalem, not defteri, çakmak, mum, 10&;#39;lu yara bandı, makas, sargı bezi ve flaster bant gibi malzemeler bulunan Deprem Çantası Acil Durum Kiti, ev ve iş yerleri için tedbir amaçlı satın alınabiliyor. Acil durumlarda kurtarıcınız olacak malzemeleri set halinde alarak, bulunduğunuz alandan çıkarken kolaylıkla ulaşabileceğiniz yerlerde muhafaza etmelisiniz.&lt;/p&gt;

